import React from "react";

const Navigation = ({ onRouteChange, isSignedIn }) => {
    if (isSignedIn) {
        return (
            <nav style={{ display: 'flex', justifyContent: 'flex-end' }}>
                <p onClick={() => onRouteChange('signin')} className='f4 link dim white underline pa4 pointer'>Sign Out</p>
            </nav>
        );
    } else {
        return (
            <nav style={{ display: 'flex', justifyContent: 'flex-end' }}>
                <p onClick={() => onRouteChange('home')} className='f4 link dim white underline pa4 pointer'>Login</p>
                <p onClick={() => onRouteChange('home')} className='f4 link dim white underline pa4 pointer'>Register</p>
            </nav>
        );
    }
}

export default Navigation;
